function createAlert(e){var t=document.getElementById("message_placeholder");t.className="alert alert-danger alert-dismissable";t.innerHTML=e;console.log("Alert Added")}function createSuccess(e){var t=document.getElementById("message_placeholder");t.className="alert alert-success alert-dismissable";t.innerHTML=e;console.log("Success Added")}function isPositiveNum(e){if(e<=0)return false;if(isNaN(e))return false;return true}function validate(){var e=true;var t="<h1>Error!</h1><br>";var n=document.getElementById("nAccounts");var r=document.getElementById("nCampers");var i=document.getElementById("nCards");var s=document.getElementById("nPeople");var o=document.getElementById("nStaff");if(!isPositiveNum(parseInt(n.value))){t+="<h4>Accounts doesn't have enough people.</h4><br>";e=false;n.parentNode.classList.add("has-error");console.log("Accounts Failed")}else{n.parentNode.classList.remove("has-error")}if(!isPositiveNum(parseInt(r.value))||parseInt(r.value)>500){t+="<h4>Error with Campers value.</h4><br>";e=false;r.parentNode.classList.add("has-error");console.log("Campers Failed")}else{r.parentNode.classList.remove("has-error")}if(!isPositiveNum(parseInt(i.value))||parseInt(i.value)>parseInt(s.value)){e=false;t+="<h4>Error with RSVP Cards.</h4><br>";i.parentNode.classList.add("has-error");console.log("RSVPCards Failed")}else{i.parentNode.classList.remove("has-error")}if(!isPositiveNum(parseInt(s.value))||parseInt(s.value)>500){e=false;t+="<h4>Error with the number of people.</h4><br>";s.parentNode.classList.add("has-error");console.log("People Failed")}else{s.parentNode.classList.remove("has-error")}if(!isPositiveNum(parseInt(o.value))||parseInt(o.value)>500){e=false;t+="<h4>Error with the number of staff.</h4><br>";o.parentNode.classList.add("has-error");console.log("Staff Failed")}else{o.parentNode.classList.remove("has-error")}if(e==false){createAlert(t);return false}else{t="<h1>Success!</h1>";createSuccess(t);return e}}function calcCFA(){var e=+document.getElementById("nAccounts").value;var t=+document.getElementById("nCampers").value;var n=+document.getElementById("nCards").value;var r=+document.getElementById("nPeople").value;var i=+document.getElementById("nStaff").value;if(!validate()){console.log("Failed Validation!");return false}var s=Math.ceil(r*(e/n)+t+i);document.getElementById("result").value=s;document.getElementById("result").focus();console.log(s)}var appCache=window.applicationCache;appCache.update();if(appCache.status==window.applicationCache.UPDATEREADY){appCache.swapCache()}document.getElementById("calculate").onclick=calcCFA